 import React from 'react';   
    
function BigArticle(props) {
    

 return(
    <div className="big-article-1"><a href="#">
        
        <div className="big-headline-1">{props.headline}</div>
        <div className="content">
            <div className="description-1">{props.description}</div>
            <div className="article-img-1"><img src={props.imgURL} alt="" srcSet=""/></div>
        </div></a>

    </div>);
}

export default BigArticle;
